import React from "react";

const BookCard = ({Book}) => {
    return (
        <>
        {/* <input type="hidden" value={Book.Id}></input> */}
        <h1>{Book.Name}</h1>
        <h1>{Book.Price}</h1>
        <h1>{Book.Category}</h1>
        <h1>{Book.Author}</h1>
        <h1>{Book.Rack}</h1>
        </>
    )
}

export default BookCard;
